import React from 'react';
import engResume from './engResume.pdf'
import actorResume from './actorResume.pdf'
import './LinkList.css'

function LinkList(props) {
  let linkStyles = '';
  let linkText = []
  let linkUrls = []
  let linkedResume = ''

  if (props.listType === 'engineer') {
    linkStyles = 'linkTextEngineer';
    linkText = [
      'resume',
      'linkedin',
      'github',
      'email',
    ]
    linkUrls = [
      {engResume},
      "https://www.linkedin.com/in/elobel/",
      "https://github.com/elobel/",
      "mailto:emilyglobel@gmail.com",
    ]
  } else {
    linkStyles = 'linkTextActor';
    linkText = [
      'resume',
      'linkedin',
      'npx',
      'email'
    ]
    linkedResume = {actorResume}
    linkUrls = [
      {actorResume},
      "https://www.linkedin.com/in/elobel/",
      "https://newplayexchange.org/users/20501/emily-lobel",
      "mailto:emilyglobel@gmail.com",
    ]
  }
  console.log(linkUrls[0])
  console.log({actorResume})

  return (
    <div>
      <ul className="linkList">
        <li>
          <a
            target="_blank"
            rel="noopener noreferrer"
            href={linkedResume}
            className={linkStyles}>
              {linkText[0]}
            </a>
        </li>
        <li>
          <a
            target="_blank"
            rel="noopener noreferrer"
            href={linkUrls[1]}
            className={linkStyles}>
              {linkText[1]}
            </a>
          </li>
        <li>
          <a
            target="_blank"
            rel="noopener noreferrer"
            href={linkUrls[2]}
            className={linkStyles}>
              {linkText[2]}
            </a>
        </li>
        <li>
          <a
            target="_blank"
            rel="noopener noreferrer"
            href={linkUrls[3]}
            className={linkStyles}>
              {linkText[3]}
          </a>
        </li>
      </ul>
    </div>
  )
}

export default LinkList;
